import './App.css';
import LogIn from './components/Login.js';
import About from './components/About.js';
import HomePage from './components/HomePage.js';
import SignIn from './components/SignIn.js';
import RecipyDetails from './components/RecipyDetails.js';
import SignUp from './components/SignUp.js';
import Recipes from './components/Recipes.js';
import Error from './components/Error.js';
import { useSelector } from "react-redux";
import { Route, Routes } from "react-router-dom";
import ShopingList from './components/‎ShopingList.js'
import Header from './components/Header.js'

function App() {
  const userId = useSelector(state => (state.userId));
  return (
    <body>
    <div>
      <Header/>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/About" element={<About />} />
        <Route path="/HomePage" element={<HomePage />} />
        <Route path="/SignIn" element={<SignIn />} />
        <Route path="/Login" element={<LogIn />} />
        <Route path="/RecipyDetails" element={<RecipyDetails />} />
        <Route path="/SignUp" element={<SignUp />} />
        <Route path="/Recipes" element={<Recipes />} />
        <Route path="/ShopingList" element={<ShopingList userId={userId} />} />
        <Route path="/*" element={<Error />} />
      </Routes>
    </div></body>
  );
}

export default App;
